import React from 'react';
import Nav from './Components/Nav'
import About from './Components/About'
import {BrowserRouter as  Route, Switch} from 'react-router-dom'

const App = () => {

    return (
        <div>
          <Nav />
          <Switch>
              <Route path='/about' component={About}/>
          </Switch>
        </div>
    )
}

export default App;
